import "./App.css";
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <Layout>
      <Routes>
        <Route exact path="/" element={<AllBeer />} />
        <Route exact path="/add-beer" element={<NewMeetupPage />} />
      </Routes>
    </Layout>
  );
}

export default App;
